import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import event_banner_1 from '../Assests/event_banner_1.jpg';
import event_banner_2 from '../Assests/event_banner_2.jpg';
import event_banner_3 from '../Assests/event_banner_3.jpg';


const Home_Carrousel = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 10,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  return (
    <div>

      
        <Slider {...settings}>
          <div>
            <img src={event_banner_1} alt="Slide 1" style={{ width: 'auto', height: '100vh', objectFit: 'cover' }} />
          </div>
          <div>
            <img src={event_banner_2} alt="Slide 2" style={{ width: '100%', height: '100vh', objectFit: 'cover' }} />
          </div>
          <div>
            <img src={event_banner_3} alt="Slide 3" style={{ width: '100%', height: '100vh', objectFit: 'cover' }} />
          </div>
        </Slider>
      
    </div>
  );
};

export default Home_Carrousel;
